 const _20161108JauneVie = "{\"parsed\":{\"_path\":\"/blog/2016-11-08-jaune-vie\",\"_dir\":\"blog\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"Jaune Vie\",\"description\":\"Cela fait un moment que je n’ai pas écrit autre chose qu’un mail, Telegram ou une ligne de code…\",\"id\":122,\"date\":\"2016-11-08T00:43:54.000Z\",\"author\":\"MarvinL\",\"layout\":\"post\",\"permalink\":\"jaune-vie/\",\"xyz_fbap\":[\"1\"],\"dsq_thread_id\":[\"6073342224\"],\"image\":\"/pictures/2016/11/book.jpg\",\"draft\":false,\"categories\":[\"JauneVie\"],\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Cela fait un moment que je n’ai pas écrit autre chose qu’un mail, Telegram ou une ligne de code…\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Me revoilà, \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"toujours le même oui\"}]},{\"type\":\"text\",\"value\":\",\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"je viens de me rendre compte que je n’avais pas posté l’article précédent, j’avoue avoir un peu honte de me plaindre de la sorte, surtout que ce n’est pas un blog anonyme, en relisant j’ai constaté que ce n’était pas de la plainte juste une analyse de ma propre situation ! (« on est pas comme ça nous. » #\"},{\"type\":\"element\",\"tag\":\"strong\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"NOWEAKNESS\"}]},{\"type\":\"text\",\"value\":\")\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Pour faire un topo, aujourd’hui on peut noter quelque peu d’évolution, des entrées d’argent pour commencer. (le nerf de la guerre ? ouai c’est ce qui paie internet surtout ! )\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Mon client à pu me régler une partie de sa dette (\"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"sans violence\"}]},{\"type\":\"text\",\"value\":\"), j’attends encore le reste en relançant à intervalles réguliers (\"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"chaque jour matin et soir, vive les spams !\"}]},{\"type\":\"text\",\"value\":\"), c’est vraiment pas une vie !\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Mais je m’en sors en pensant que c’est une sécurité, si besoin (j’espère ne pas en arriver la) je sais que j’ai une belle somme dans la poche de cet individu. Mon parachute à moi…\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Des contrats signés et terminés, d’autres en cours et de nouveaux en route.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{\"style\":\"text-align: center;\"},\"children\":[{\"type\":\"text\",\"value\":\"\\n  Ça vient je l’avais dit !\\n\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"En venant écrire ici j’étais a nouveau dans un mood assez bas mais ça remonte déjà, je ne me rappelle plus ce que j’étais venu vous dire.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"On est dimanche et j’ai passé la journée a la maison (ça change ? \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"non pas vraiment\"}]},{\"type\":\"text\",\"value\":\"), évidemment mes yeux commencent à n’en plus pouvoir, l’heure tardive n’arrange rien.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"J’ai trouvé un site super captivant qui recense les nouveautés du monde informatique, les applis, plateformes, services et outils qui sortent chaque jour. (ProductHunt : \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://www.producthunt.com\",\"rel\":[\"nofollow\"],\"target\":\"_blank\"},\"children\":[{\"type\":\"text\",\"value\":\"https://www.producthunt.com\"}]},{\"type\":\"text\",\"value\":\")\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Il y en a pour tous les domaines, de l’appli pour gérer ton temps et planifier tes taches (LiquidTime : \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://liquidti.me\",\"rel\":[\"nofollow\"],\"target\":\"_blank\"},\"children\":[{\"type\":\"text\",\"value\":\"https://liquidti.me\"}]},{\"type\":\"text\",\"value\":\") au service qui regroupe toute la logistique de gestion/achat de noms de domaines par exemple (Nuage : \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://www.nuageapp.com/\",\"rel\":[\"nofollow\"],\"target\":\"_blank\"},\"children\":[{\"type\":\"text\",\"value\":\"https://www.nuageapp.com/\"}]},{\"type\":\"text\",\"value\":\").\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Bref j’ai fouillé et trouvé des choses intéressantes que je vais tester et surement vous en faire un retour. Je suis aussi tombé sur \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://1001startups.fr\",\"rel\":[\"nofollow\"],\"target\":\"_blank\"},\"children\":[{\"type\":\"text\",\"value\":\"https://1001startups.fr\"}]},{\"type\":\"text\",\"value\":\" et c’est aussi très enrichissant.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"A côté de ça, je me suis lancé dans une illustration pour le site d’un de mes projets qui était trop textuel. L’imagination c’est une chose, la réalisation en est une autre. Je n’avais pas eu l’occasion de réellement travailler sur Illustrator depuis que j’ai la derniere version. Bon sur 3 parties j’en ai fini 1 et à peine entamé une autre, le problème est que l’envie est partie !\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ce serait génial si petit lecteur tu étais illustrateur ou graphiste ! J’ai du boulot pour toi (for REAL).\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Quoi d’autre ? Ah oui, on est dans un rush pour lancer notre premier projet de couple (\"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"ça pue l’amour tout ça\"}]},{\"type\":\"text\",\"value\":\") et c’est pas simple simple à vrai dire, la majeure partie de ma soirée fut de me prendre la tête sur mon super cahier de récup à gribouiller des réflexions, calculs sans trouver de solutions réelle.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ah oui ! Il faut que je vous parle du Mind-mapping, une autre découverte très utile pour les esprits fous comme le mien !\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Ça fait un bel article non ? Allez ça suffit !\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"(Celui qui à lu jusqu’ici mérite un shootout, manifeste-toi !)\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:blog:2016-11-08-jaune-vie.md\",\"_source\":\"content\",\"_file\":\"blog/2016-11-08-jaune-vie.md\",\"_stem\":\"blog/2016-11-08-jaune-vie\",\"_extension\":\"md\"},\"hash\":\"4zU7eUC72y\"}";

